    subroutine checkStatus(status)
        use iso_c_binding, only: c_int
        integer(c_int), intent(in) :: status
        if (status /= 0) then
            print *, 'Status: ', status
        end if
        !TODO if status /= 0 goto cleanup
    end subroutine


